	public static void main(String[] arg) throws Exception {
		TestAzureusUsingChainCompressionCache.loadAndIndexGraph();
		profile(TestAzureusUsingChainCompressionCache.class,"testGetReachableVerticesOUT",getTestData());
		profile(TestAzureusUsingChainCompressionCache.class,"testGetReachableVerticesIN",getTestData());
		profile(TestAzureusUsingChainCompressionCache.class,"testIsReachableOUT",getTestData());
		profile(TestAzureusUsingChainCompressionCache.class,"testIsReachableIN",getTestData());
		profile(TestAzureusUsingChainCompressionCache.class,"testUsingJungDijkstraOnline",getTestData());
	}
	
